import HeroBanner from "../components2/Herobanner";
import Problem from "../components2/Problemsection";
import Features from "../components2/Features";
import Governmentscheme from "../components2/Governmentschemes";
import Navbar from "./navbar";
import searchicon from "../assests/search-icon.png";
export default function Home() {
    return (
        <div className="w-[100%] p-[30px]">
            <div>
                <div>
                    <h1 className="text-[40px] font-bold text-[white]">Welcome User!,</h1>
                    <p className="text-[white]">Your benefits overview</p>
                </div>
                <button>
                    <ul className="flex">
                        <li className=""><img src={searchicon} alt="search icon" /></li>
                        <li className="">Discover More</li>
                    </ul>
                </button>
            </div>
        </div>
    )
}
